{'obj': {'id': 22061687, 'name': 'Hey Julie! (feat. Lil Yachty)', 'isrc': 'USAT21812415', 'image_url': 'https://i.scdn.co/image/045f3afa95a270fb9af82809df85119d16803530', 'duration_ms': 156637, 'composer_name': 'Lil Yachty, KYLE, Maurice Powell, Naz, Ray Jacobs & SuperDuperBrick', 'artists': [{'id': 207462, 'name': 'KYLE', 'image_url': 'https://i.scdn.co/image/09b2ac3797fd2181917f20871ff396c441603312', 'cover_url': 'https://i.scdn.co/image/b638f6da9fd1e96629c4c08bc96942deead68fec', 'code2': 'US', 'gender': 1, 'isni': None, 'description': 'Multi-platinum, chart topping rapper and actor KYLE has become one of music&#39;s hottest breakout stars. His 4X-platinum smash single, &quot;<a href="spotify:album:15qLmAABocTCRBSbWWqL7K" data-name="iSpy (feat. Lil Yachty)">iSpy (feat. Lil Yachty)</a>&quot; hit #1 on the Billboard Hot Rap Songs, #4 on the Billboard Hot 100, while going on to become one of the most streamed songs of 2017. The song&#39;s Colin Tilley-directed companion visual was nominated at the 2017 MTV Video Music Awards for Best Visual Effects. The Ventura, CA native - who has collaborated with the likes of <a href="spotify:artist:1anyVhU62p31KFi8MEzkbf" data-name="Chance The Rapper">Chance The Rapper</a>, <a href="spotify:artist:02kJSzxNuaWGqwubyUba0Z" data-name="G-Eazy">G-Eazy</a>, <a href="spotify:artist:4xRYI6VqpkE3UwrDrAZL8L" data-name="Logic">Logic</a>, <a href="spotify:artist:0cGUm45nv7Z6M6qdXYQGTX" data-name="Kehlani">Kehlani</a>, <a href="spotify:artist:6VuMaDnrHyPL1p4EHjYLi7" data-name="Charlie Puth">Charlie Puth</a>, <a href="spotify:artist:7c0XG5cIJTrrAgEC3ULPiq" data-name="Ty Dolla $ign">Ty Dolla $ign</a>, <a href="spotify:artist:360IAlyVv4PCEVjgyMZrxK" data-name="Miguel">Miguel</a>, and more - was named a part of XXL&#39;s 2017 Freshman Class, gracing the publication&#39;s esteemed annual cover, while also being featured in a wide array of publications ranging from Rolling Stone, Entertainment Weekly and Billboard to PAPER, NYLON and The FADER. He&#39;s taken his energetic live show to national television stages with performances on the 2017 MTV Video Music Awards, Jimmy Kimmel Live! and the Teen Choice Awards 2017.

In November 2017, KYLE teamed up with UGG to become the ambassador for the brand&#39;s Fall/Winter 2017 partnership with FootAction, as well as the serving as the face of ESPN&#39;s College Basketball campaign. With the release of &quot;<a href="spotify:album:50wx4dOnpboFj6n8z1otyb" data-name="To The Moon">To The Moon</a>,&quot; the first official single from his forthcoming new album, a set at this year&#39;s Coachella festival and a lead role in his first feature film, the Netflix original hip-hop comedy &quot;The After Party,&quot; 2018 is looking to be another blockbuster year for KYLE.
